import React from 'react'

function Header() {
    return (
        <header>
            <h1 className='main-header'>Guess My Number!</h1>
            <p className='between'>(Between 1 and 20)</p>
            <button className='again'>Again!</button>
            <div className='what'>?</div>
        </header>
    )
}

export default Header
